  false,\n\t\"url\": null,\n\t\"notes\": \"Investigation of the endangered Aleutian
  Canada goose (Branta canadensis leucopareia) was conducted from 1974 to 1976, again
  in 1977 and in 1979 on Buldir. During the initial three summers, biologists from
  the Aleutian Islands N.W.R. studied the basic breeding biology of this Canada goose
  subspecies. The data obtained, plus extensive vegetative mapping of Buldir lead
  to the development of a stratified random sampling technique to estimate the size
  of the breeding population. This technique utilized the examination of randomly
  selected plots within four strata of potential goose nesting habitat on the island.
  This technique was employed in 1977, 1979, and again in 1982, when researchers from
  the refuge worked on the island (see Progress Report of Aleutian Canada Geese on
  Buldir Island by D. Woolington & Tom Early, 1977, and same title by W. Henry and
  T. Early, 1979). During the 1982 breeding season a six person team of refuge personnel
  returned to Buldir to conduct the nesting study during the random sampling technique.
  The investigators stayed on Buldir 31 days from 29 May to 28 June. The completion
  of the goose nesting study was the sole objective of this team.\",\n\t\"owner_org\":
